import React, { useState } from 'react';

function Join() {
    const [formData, setFormData] = useState({
        username: '',
        password: '',
        email: '',
        phonenumber: '',
        addr: ''
    });

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({
            ...formData,
            [name]: value
        });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        // 폼 데이터 처리 로직 추가
        console.log('Form submitted:', formData);
    };

    return (
        <div style={{ marginTop: '5rem', display: 'flex', justifyContent: 'center' }}>
            <div style={{ width: '30rem', boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)', borderRadius: '8px', overflow: 'hidden', backgroundColor: '#fff' }}>
                <div style={{ padding: '2rem' }}>
                    <h4 style={{ textAlign: 'center', marginBottom: '1.5rem', fontSize: '1.5rem', color: '#333' }}>회원 가입</h4>
                    <form onSubmit={handleSubmit}>
                        <div>
                            <label htmlFor="username" style={{ fontWeight: 'bold', marginBottom: '0.5rem', display: 'block', color: '#555' }}>아이디:</label>
                            <input
                                type="text"
                                id="username"
                                name="username"
                                value={formData.username}
                                onChange={handleChange}
                                required
                                style={{ width: '100%', padding: '0.5rem', marginBottom: '1rem', border: '1px solid #ccc', borderRadius: '4px', boxSizing: 'border-box' }}
                            />
                        </div>

                        <div>
                            <label htmlFor="password" style={{ fontWeight: 'bold', marginBottom: '0.5rem', display: 'block', color: '#555' }}>비밀번호:</label>
                            <input
                                type="password"
                                id="password"
                                name="password"
                                value={formData.password}
                                onChange={handleChange}
                                required
                                style={{ width: '100%', padding: '0.5rem', marginBottom: '1rem', border: '1px solid #ccc', borderRadius: '4px', boxSizing: 'border-box' }}
                            />
                        </div>

                        <div>
                            <label htmlFor="email" style={{ fontWeight: 'bold', marginBottom: '0.5rem', display: 'block', color: '#555' }}>이메일:</label>
                            <input
                                type="email"
                                id="email"
                                name="email"
                                value={formData.email}
                                onChange={handleChange}
                                required
                                style={{ width: '100%', padding: '0.5rem', marginBottom: '1rem', border: '1px solid #ccc', borderRadius: '4px', boxSizing: 'border-box' }}
                            />
                        </div>

                        <div>
                            <label htmlFor="phonenumber" style={{ fontWeight: 'bold', marginBottom: '0.5rem', display: 'block', color: '#555' }}>전화번호:</label>
                            <input
                                type="tel"
                                id="phonenumber"
                                name="phonenumber"
                                value={formData.phonenumber}
                                onChange={handleChange}
                                pattern="^\d{3}-\d{3,4}-\d{4}$"
                                placeholder="010-1234-5678"
                                required
                                style={{ width: '100%', padding: '0.5rem', marginBottom: '1rem', border: '1px solid #ccc', borderRadius: '4px', boxSizing: 'border-box' }}
                            />
                        </div>

                        <div>
                            <label htmlFor="addr" style={{ fontWeight: 'bold', marginBottom: '0.5rem', display: 'block', color: '#555' }}>주소:</label>
                            <textarea
                                id="addr"
                                name="addr"
                                rows="3"
                                value={formData.addr}
                                onChange={handleChange}
                                required
                                style={{ width: '100%', padding: '0.5rem', marginBottom: '1rem', border: '1px solid #ccc', borderRadius: '4px', boxSizing: 'border-box' }}
                            ></textarea>
                        </div>

                        <hr />
                        <div style={{ display: 'flex', justifyContent: 'space-between' }}>
                            <button
                                type="submit"
                                style={{ backgroundColor: '#28a745', color: '#fff', border: 'none', padding: '0.5rem 1rem', borderRadius: '4px', cursor: 'pointer', fontSize: '1rem' }}
                                onMouseOver={(e) => e.target.style.backgroundColor = '#218838'}
                                onMouseOut={(e) => e.target.style.backgroundColor = '#28a745'}
                            >
                                가입하기
                            </button>
                            <a
                                href="/products/all"
                                style={{ backgroundColor: '#6c757d', color: '#fff', padding: '0.5rem 1rem', borderRadius: '4px', textDecoration: 'none', display: 'inline-block', fontSize: '1rem' }}
                                onMouseOver={(e) => e.target.style.backgroundColor = '#5a6268'}
                                onMouseOut={(e) => e.target.style.backgroundColor = '#6c757d'}
                            >
                                뒤로가기
                            </a>
                        </div>
                    </form>
                </div>
            </div>
        </div>
    );
}

export default Join;
